/*Table structure for table `mall_advertise` */

DROP TABLE IF EXISTS `mall_advertise`;

CREATE TABLE `mall_advertise` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `ad_type` int(11) DEFAULT NULL COMMENT '广告类型 1，轮播下广告位 2，登录 3 头部广告 4 类目广告 5 猜你喜欢 7积分商城首页广告 8积分商城首页商品推荐位 9积分商城兑你喜欢 10旗舰店底部广告位',
  `ad_title` varchar(512) DEFAULT NULL COMMENT '广告标题',
  `ad_url` varchar(512) DEFAULT NULL COMMENT '广告指向链接',
  `ad_src` varchar(512) DEFAULT NULL COMMENT '图片链接',
  `start_time` datetime DEFAULT NULL COMMENT '定时发布时间',
  `end_time` datetime DEFAULT NULL COMMENT '定时结束时间',
  `sort_num` int(6) DEFAULT NULL COMMENT '序号',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `platform_id` int(20) DEFAULT NULL COMMENT '平台ID',
  `close` int(6) DEFAULT '1' COMMENT '是否可关闭 1 可关闭 2 不可关闭',
  `cid` int(20) DEFAULT NULL COMMENT '类目id （一级类目）',
  `status` int(6) DEFAULT NULL COMMENT '1是 发布 0 未发布',
  `adv_type` tinyint(4) DEFAULT NULL COMMENT '1：首页 2：类目 3：地区 4：积分商城',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'skuId',
  `integral` int(11) DEFAULT NULL COMMENT '积分',
  `is_delete` int(11) DEFAULT NULL COMMENT '是否删除 1、删除',
  `theme_id` int(6) DEFAULT NULL COMMENT '频道ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=192 DEFAULT CHARSET=utf8 COMMENT='商城广告';

