/*Table structure for table `mall_banner` */

DROP TABLE IF EXISTS `mall_banner`;

CREATE TABLE `mall_banner` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `banner_url` varchar(512) DEFAULT NULL COMMENT '图片url',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '平台id',
  `sort_number` smallint(6) DEFAULT NULL COMMENT '排序序号',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `status` tinyint(4) DEFAULT NULL COMMENT '0:不可用 1：可用',
  `start_time` datetime DEFAULT NULL COMMENT '开始展示时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `banner_link` varchar(512) DEFAULT NULL COMMENT '跳转链接',
  `title` varchar(1024) DEFAULT NULL COMMENT '标题',
  `banner_type` tinyint(4) DEFAULT NULL COMMENT '1：mall 4：积分商城',
  `integral` int(11) DEFAULT NULL COMMENT '积分',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'skuId',
  `theme_id` bigint(20) DEFAULT NULL COMMENT '频道ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=utf8 COMMENT='商城轮播';

