/*Table structure for table `mall_info` */

DROP TABLE IF EXISTS `mall_info`;

CREATE TABLE `mall_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(64) DEFAULT NULL COMMENT '网站名称',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '买家id',
  `logo` varchar(512) DEFAULT NULL COMMENT '商户logo图片地址',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `domain` varchar(512) DEFAULT NULL,
  `need_auth` int(11) DEFAULT NULL COMMENT '平台买家购买时必须通过认证 1是 2不是',
  `short_name` varchar(20) DEFAULT NULL COMMENT '商铺的简称，用于卖场首页右边楼层显示',
  `status` int(11) DEFAULT NULL COMMENT '备用状态字段',
  `platform_qq` varchar(128) DEFAULT NULL COMMENT '平台qq',
  `jfcp_account` varchar(512) DEFAULT NULL COMMENT '平台在金融云账号',
  `full_name` varchar(512) DEFAULT NULL COMMENT '平台在金融云中全名',
  `payment_channel` smallint(6) DEFAULT NULL COMMENT '所属银行',
  `bankuser_name` varchar(64) DEFAULT NULL COMMENT '平台在银行网银登陆账号',
  `bankmaster_account_no` varchar(45) DEFAULT NULL COMMENT '银行分配给平台主账号',
  `bankmaster_account_name` varchar(128) DEFAULT NULL COMMENT '平台在银行主账号名称',
  `commission_account_no` varchar(45) DEFAULT NULL COMMENT '平台佣金账号',
  `gather_account_no` varchar(45) DEFAULT NULL COMMENT '平台收款账号',
  `bank_withdraw_delegate` varchar(45) DEFAULT NULL COMMENT '代理出金账户',
  `bank_interest` varchar(45) DEFAULT NULL COMMENT '公共计息收费',
  `bank_adjustment` varchar(45) DEFAULT NULL COMMENT '公共调账',
  `bank_initializer` varchar(45) DEFAULT NULL COMMENT '资金初始化',
  `cluster_id` bigint(20) DEFAULT NULL COMMENT '集群ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='商城信息';

/*Data for the table `mall_info` */

insert  into `mall_info`(`id`,`title`,`platform_id`,`logo`,`created`,`modified`,`domain`,`need_auth`,`short_name`,`status`,`platform_qq`,`jfcp_account`,`full_name`,`payment_channel`,`bankuser_name`,`bankmaster_account_no`,`bankmaster_account_name`,`commission_account_no`,`gather_account_no`,`bank_withdraw_delegate`,`bank_interest`,`bank_adjustment`,`bank_initializer`,`cluster_id`) values (4,'DPI',2,'/2015/11/22/16ce4949-be4f-48f5-b445-14c63445b7c2.png','2015-11-22 20:18:03','2015-11-22 20:18:03',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'DPI',NULL,'/2016/4/8/433c6ad4-50e6-46cb-999f-d4649427ce60.jpg','2015-11-22 20:20:19','2015-11-22 20:20:19',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);

/*Table structure for table `mall_notice` */

DROP TABLE IF EXISTS `mall_notice`;

CREATE TABLE `mall_notice` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL COMMENT '公告标题',
  `content` text COMMENT '公告内容',
  `status` tinyint(10) DEFAULT NULL COMMENT '1发布，2草稿',
  `created` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `modified` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `sort_num` tinyint(10) DEFAULT NULL COMMENT '排序号',
  `is_recommend` tinyint(10) DEFAULT NULL COMMENT '是否置顶 0 否 1是',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '0 平台用户 其他对应用户公告',
  `notice_type` int(1) DEFAULT NULL COMMENT '公告类型 1 文字公告 2 链接公告',
  `url` varchar(1000) DEFAULT NULL COMMENT '公告链接 公告类型为2时不可空',
  `theme_type` tinyint(4) DEFAULT NULL COMMENT '1、首页；2、类目:3、地区',
  `theme_id` int(20) DEFAULT NULL COMMENT '频道ID',
  PRIMARY KEY (`id`)
