/*Table structure for table `mall_recommend` */

DROP TABLE IF EXISTS `mall_recommend`;

CREATE TABLE `mall_recommend` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `floor_num` smallint(6) DEFAULT NULL COMMENT '楼层编号',
  `title` varchar(16) DEFAULT NULL COMMENT '标题',
  `position` smallint(6) DEFAULT NULL COMMENT '1:左，2：中，3：右',
  `rec_type` smallint(6) DEFAULT NULL COMMENT '1,网站首页 2：类目',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `status` smallint(6) DEFAULT NULL COMMENT '显示状态  0表示不显示 1表示显示',
  `category_id` bigint(20) DEFAULT NULL COMMENT '类目id',
  `smalltitle` varchar(4) DEFAULT NULL COMMENT '右侧短名称',
  `colorref` varchar(64) DEFAULT NULL COMMENT '色值',
  `bg_color` varchar(64) DEFAULT NULL COMMENT '楼层背景色',
  `theme_id` bigint(20) DEFAULT NULL COMMENT '频道ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='商城推荐';

