/*Table structure for table `mall_recommend_attr` */

DROP TABLE IF EXISTS `mall_recommend_attr`;

CREATE TABLE `mall_recommend_attr` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `item_id` int(20) DEFAULT NULL COMMENT '商品编号',
  `platform_id` int(20) DEFAULT NULL COMMENT '平台id',
  `source` int(6) DEFAULT NULL COMMENT '1:选择的商品 2:类目中查询的商品',
  `rec_id` int(20) DEFAULT NULL COMMENT '推荐父id 即楼层id',
  `rec_type` int(6) DEFAULT NULL COMMENT '推荐类型 1,，表示商品  2，表示图片链接类型 3，顶部广告,4.底部广告',
  `end_time` datetime DEFAULT NULL COMMENT '结束显示时间',
  `status` int(6) DEFAULT NULL COMMENT '显示状态 0：不显示 1：显示',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `pic_src` varchar(512) DEFAULT NULL COMMENT '图片地址',
  `url` varchar(512) DEFAULT NULL COMMENT '图片链接',
  `ad_words` varchar(512) DEFAULT NULL COMMENT '广告词',
  `title` varchar(512) DEFAULT NULL COMMENT '图片标题',
  `sort_number` int(6) DEFAULT NULL COMMENT '排序序号',
  `start_time` datetime DEFAULT NULL COMMENT '开始显示时间',
  `type` int(6) DEFAULT NULL COMMENT '楼层推荐位类型 1：首页 2：类目',
  `theme_id` bigint(20) DEFAULT NULL COMMENT '频道ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8;

