/*Table structure for table `mall_theme` */

DROP TABLE IF EXISTS `mall_theme`;

CREATE TABLE `mall_theme` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `theme_name` varchar(100) DEFAULT NULL COMMENT '主题名称',
  `primary_cid` bigint(20) DEFAULT NULL COMMENT '一级类目id',
  `cId` bigint(20) DEFAULT NULL COMMENT '二级类目ID',
  `clev` bigint(3) DEFAULT NULL COMMENT '类目级别 2二级类目',
  `addressId` bigint(20) DEFAULT NULL COMMENT '地区ID',
  `type` bigint(3) DEFAULT NULL COMMENT '1：首页  2：类目子站 3：地区子站',
  `color` varchar(20) DEFAULT NULL COMMENT '颜色',
  `status` smallint(6) DEFAULT NULL COMMENT '状态：1、可用 2、不可用 3、已删除',
  `userId` varchar(100) DEFAULT NULL COMMENT '用户ID',
  `sort_num` smallint(6) DEFAULT NULL COMMENT '排序号',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `color_b` varchar(20) DEFAULT NULL COMMENT '颜色',
  `provinceCode` bigint(20) DEFAULT NULL,
  `cityCode` bigint(20) DEFAULT NULL,
  `villageCode` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=72 DEFAULT CHARSET=utf8;

