/* Procedure structure for procedure `DayRangeProc` */

/*!50003 DROP PROCEDURE IF EXISTS  `DayRangeProc` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `DayRangeProc`(IN start_date DATETIME , IN end_date DATETIME )
BEGIN 
	      DECLARE temp  INT; 
	      DECLARE range_day  INT; 
	      SET temp = 0; 
	      SET range_day = (SELECT DATEDIFF(end_date,start_date)); 
	      DELETE FROM date_dic WHERE dated>=start_date AND dated<= end_date;
	      #删除日期内的数据 避免冲突
	      SET @sqlstr=CONCAT('delete from date_dic where dated>=DATE_FORMAT(''',start_date,''',''%Y%m%d'') and dated<=DATE_FORMAT(''',end_date,''',''%Y%m%d'')');   
	      PREPARE stmt FROM @sqlstr;  
	      EXECUTE stmt;  
	      DEALLOCATE PREPARE stmt;
	      		
	      #往数据库里循环增加日期	
	      WHILE temp  <= range_day DO 
		    INSERT INTO date_dic(dated) VALUES (DATE_FORMAT(ADDDATE(start_date,temp),'%Y%m%d'));
		    SET temp = temp + 1; 
	      END WHILE; 
	      COMMIT;
	END */$$
DELIMITER ;

